import React from 'react';
// @ts-ignore
import './css/navbar.css';

function Nabvar({categories}) {
    return (
        <div className="nav-bar">
            <div className="nav-bar-left">
                <h1>Video Gallery</h1>
                <button>Category
                    <i class="fa fa-caret-down"></i>
                </button>
            </div>

            <div className="nav-bar-right">

            </div>
        </div>
    );
}

export default Nabvar;
